import React from "react";
import '../styles/Navbar.css';

function Navbar() {
    return (
        <nav>
            <div className='logo'>
                <h4>plant recipes</h4>
            </div>
            <ul className='nav-links'>
                <li>home</li>
                <li>about</li>
                <li>contact</li>
            </ul>
        </nav>
    )
}

export default Navbar;
